import { Link, useStaticQuery, graphql } from "gatsby"
import PropTypes from "prop-types"
import React, { useState } from "react"
import { View, Dimensions } from "react-native"
import Image from "./img"
import { useSpring, animated } from 'react-spring'

const { width, height } = Dimensions.get("window")
const Header = ({ siteTitle }) => {
  return (
    <div >
      <div style={{ display: "flex", flexDirection: "row", zIndex: 1 }}>
        <Link to="/">
          <Image
            imgData={useStaticQuery(graphql`
        query {
            placeholderImage: file(relativePath: { eq: "icon/icon.png" }) {
                childImageSharp {
                    fluid(maxWidth: 300) {
                        ...GatsbyImageSharpFluid
                    }
                }
            }
        }`)}
            style={{ zIndex: 100 }}
          />
        </Link>
        <div style={{ backgroundColor: "#fff", flex: 1, height: 100, display: "flex" }}>
          {width > 480 && <div style={{ backgroundColor: "#00f", flex: 1, display: "flex", flexDirection: "column" }}>
            <div style={{ backgroundColor: "#f0f", flex: 1, display: "flex", justifyContent: "flex-end", alignItems: "center" }}>
              <Link style={{ margin: 10, color: "#555" }} to="/ConnectedYou">Connected You</Link>
              <Link style={{ margin: 10, color: "#555" }} to="/App">App</Link>
              <Link style={{ margin: 10, color: "#555" }} to="/Support">Support</Link>
              <Link style={{ margin: 10, color: "#555" }} to="/aboutUs">About Us</Link>
            </div>
            <div style={{ backgroundColor: "#0ff", flex: 1, display: "flex" }}></div>
          </div>}
          <MobileHeaderContainer />
        </div>
      </div>
    </div>
  )
}

interface MobileHeaderContainerProps {
}
const MobileHeaderContainer = ({ }: MobileHeaderContainerProps) => {
  const [state, setState] = useState(false)
  const animationStyle = useSpring({ top: state ? 100 : -height })


  if (width <= 480)
    return (
      <>
        <div style={{ display: "flex", justifyContent: "flex-end", alignItems: "center", backgroundColor: "#fff", flex: 99, height: "100%" }}>
          <div style={{ height: 50, width: 50, backgroundColor: "#00f", marginRight: 15 }} onClick={() => {
            setState(!state)
          }}>
          </div>
        </div>

        {/* Sec: Absolute Container */}
        <animated.div style={{ backgroundColor: "#eee", height: height, width: "100vw", position: "absolute", top: 100, left: 0, zIndex: 1, ...animationStyle }}>

        </animated.div>

      </>
    )
  return (<></>)
}

Header.propTypes = {
  siteTitle: PropTypes.string,
}

Header.defaultProps = {
  siteTitle: ``,
}

export default Header
